import React, { Component } from 'react';
import Window from './Types';
import './App.css';
import ControlPanel from './ControlPanel'
import Runner from './Runner'

class App extends Component {
  render() {
    return (
      <div className="App">
        <ControlPanel />
        <Runner />
      </div>
    );
  }
}

export default App;
